import React, { useState } from 'react'
import { Button } from '@mui/material'
import { AppBar, Grid, Toolbar, Tabs, Tab, Typography, useTheme, useMediaQuery } from '@mui/material';
import NewspaperOutlinedIcon from '@mui/icons-material/NewspaperOutlined';
import Drawercomp from './Drawercomp';

const Home = ({links}) => {
    const theme = useTheme();
    const isMatch = useMediaQuery(theme.breakpoints.down('sm'));
    const [value, setValue] = useState()//0
  return (
    <div>
        <AppBar sx={{backgroundImage:'linear-gradient(90deg, rgba(55,46,210,1) 0%, rgba(24,24,167,0.8744747899159664) 69%, rgba(179,0,255,1) 100%);'}}>
            <Toolbar>
                <Drawercomp></Drawercomp>
                <Grid sx={{placeItems:'center'}} container>
                    <Grid item xs={2}>
                        <Typography>
                            <NewspaperOutlinedIcon></NewspaperOutlinedIcon>
                        </Typography>
                    </Grid>
                    <Grid item xs={6}>
                        <Tabs
                          indicatorColor='secondary'
                          textColor='inherit'
                          value={value}
                          onChange={(e,val)=> setValue(val)}>
                            {links.map((link,index)=>(
                                <Tab key={index} label={link}/>
                            ))}
                        </Tabs>
                    </Grid>
                    <Grid item xs={2}/>
                    
                </Grid>
            </Toolbar>
        </AppBar>
        <Button variant="text">Text</Button>
    </div>
  )
}

export default Home
